function App() {
  return (
    <div>
      <Router>

      <Header />
        <div className="container">


                        <Switch>
                           <Route path = "/" component = {ListEmployesCompents}></Route>
                          <Route path = "/employees" component = {ListEmployesCompents}></Route>
                          <Route path = "/add-employee/:id" component = {CreateEmployeeComp}></Route>
                        </Switch>


        </div> 
        <Footer />   
    </Router>
    </div>
  );
}

export default App;
